 export default function Navbar() {
   
  Axios.defaults.withCredentials = true;
const [user, setUser] = useState({
  username: "",
  userid: ""
})


useEffect(() => {
setUser(window.sessionStorage.getItem("user"))
}, [])
  console.log(user);
  return (
    <div className="navbar-header">
      <div>Hi {user && user.username}</div>
